import {Link} from 'react-router-dom';
import {useForm} from 'react-hook-form'
import checkemail from '../../assets/home/icons/check_email.svg';
import arrow from '../../assets/home/icons/grey_arrow-right.svg'

import Login from "./Login";


export default function CheckEmail () {
    const form = useForm();

    return(
        <section className="modal">
            <form>
                
            </form>
            <img  className="form_img" src={checkemail} alt="check your email"/>
            <h1>Check your email</h1>
            <p>We sent a password reset link to @loremipsum@gmail.com</p>
            <button> Open email app</button>
            <p> Didn't receive the email? Click to resend</p>
            <section className="additionals">
                <Link to="/login" element={<Login/>}>
          <button><img src={arrow} alt="back to login"/> Back to Login</button>
             </Link>
            </section>
        </section>
    )
}
